const GlobalStyle = createGlobalStyle`
.pause_referral_ani {
  #referral_lighter_1, #referral_details_1, #referral_dot_1, #referral_lighter_2, #referral_details_2, #referral_dot_2, #referral_lighter_3, #referral_details_3, #referral_dot_3, #referral_lighter_4, #referral_details_4, #referral_dot_4, #referral_lighter_5, #referral_details_5, #referral_dot_5, #referral_lighter_6, #referral_details_6, #referral_dot_6 {
    animation-name: none;
  }


}
${() => {
  return Array.from({ length: 6 }, (_, v) => v)
    .map((v) => {
      const start = (v * 100) / 6
      const middle_1 = start + 100 / 30
      const middle_2 = start + (3 * 100) / 30
      const end = start + (4 * 100) / 30
      return `
      #referral_lighter_${v + 1}, #referral_details_${v + 1}, #referral_dot_${v + 1} {
        animation-name: referral_ani_${v + 1};
        animation-duration: 20s;
        animation-iteration-count: infinite;
      }
      @keyframes referral_ani_${v + 1} {
        ${start}% {
          opacity: 0;
        }
        ${middle_1}% {
          opacity: 1;
        }
        ${middle_2}% {
          opacity: 1;
        }
        ${end}% {
          opacity: 0;
        }
      }
    `
    })
    .join('')
}}
`

